import React from 'react';
import PropTypes from 'prop-types';
import { Form, FormField, Label } from 'semantic-ui-react';

const Edit = ({ patchUser, loadUser }) => {
  useEffect(() => {
    loadUser();
  }, [loadUser]);
  return (
    <Form onSubmit={patchUser}>
      <FormField>
        <Input></Input>
      </FormField>
    </Form>
  );
};

Edit.propTypes = {
  submitEdit: PropTypes.func.isRequired,
};

export default Edit;
